import React, { Fragment, useEffect, useState } from "react";
import Button from "../component/Button";
import "./SvePrikaz.css";

function SvePrikaz(props) {
    const [auto, setAuto] = useState();
  function nazadHandler() {
    props.setDalje(false);
    props.clearHandler();
  }
  useEffect(() => {
    console.log(props.auto);
    console.log(props.auto);
    console.log(props.usluge);
    console.log(props.popust);
    console.log(props.cijena);
    let odabir = props.auto.map((a, v) =>
      a !== undefined ? setAuto(a.value) : console.log("sranje")
    );
    console.log(odabir, "odabir");
  }, []);

  return (
    <Fragment>
      <div className="svegori">
        <div>
          <h1>Model Vozila</h1>
          <p>{auto}</p>
        </div>
        <div>
          <h1>Odabrane Usluge</h1>
          <p></p>
        </div>
      </div>
      <h1 className="prikaz">Kontakt Podatci</h1>
      <div className="svedoli">
        <p>Ime i prezime: {props.ime}</p>
        <p>Broj telefona: {props.broj}</p>
        <p>Email adresa: {props.email}</p>
        <p>Napomena: {props.napomena}</p>
      </div>
      <div className="buttons">
        <Button onClick={nazadHandler}>Nazad</Button>
        {/* {setdalje && <Button onClick={daljeHandler}>Dalje</Button>} */}
      </div>
    </Fragment>
  );
}

export default SvePrikaz;
